    CONVERSION_RATES = {'Ar': 478, 'Ba': 82, 'Cr': 6, 'Cz': 21, 'Do': 48, 'Ph': 50, 'Uz': 10000, 'Ha': 64, 'Gu': 7, 'Ta': 32, 'Ro': 4, 'Eg': 18, 'Vi': 22573, 'In': 63, 'Ni': 31, 'Ve': 10, 'No': 8, 'Ja': 111, 'Sa': 3, 'Th': 32, 'Ke': 102, 'So': 1059}
    first_letter = currency[1].lower()
    is_vowel = first_letter in 'aeiou'
    rate_key = currency[:2]
    conversion_rate = CONVERSION_RATES.get(rate_key, 0)
    if not is_vowel:
        conversion_rate = int(str(conversion_rate), 2)
    converted_amount = usd * conversion_rate
    return f'You now have {converted_amount} of {currency}.'
